import React, { useState, useEffect } from "react";

function Home() {
  const [isAdmin, setIsAdmin] = useState(false)

  useEffect(() => {
      if (window.localStorage.getItem("username") === "admin") {
        setIsAdmin(true)
      } else {
        setIsAdmin(false)
      }
  }, [])

  return (
    <div style={{ backgroundColor: "green", width: "100%", height: "80%" }}>
      {isAdmin ? (
        <>
          <div className='endpoint'>
            <p>PUT</p>
            <p>/signup</p>
            <p>requested Number</p>
          </div>
          <div className='endpoint'>
            <p>GET</p>
            <p>/login</p>
            <p>requested Number</p>
          </div>
        </>
      ) : (
        <></>
      )}
    </div>
  );
}

export default Home;
